    false,nt"url": null,nt"notes": "This annual narrative report for St. Croix
    Wetland Management District summarizes district activities during the 1996 calendar
    year.  The report begins with a summary of the years highlights and climatic conditions.
      Land acquisition is also covered.  The report includes a planning section which
    discusses master plan, management plan, public participation, compliance with environmental
    and cultural mandates, research and investigations. Administration is outlined;
    information about personnel, volunteer programs, funding, safety, technical assistance,
    and other items is given.  Habitat management is also covered.  Subjects include
    general, wetlands, forests, croplands, grasslands, other habitats, grazing, haying,
    fire management, pest control, wilderness and special areas, and WPA easement monitoring,
    pest control.  The wildlife section of the report discusses wildlife diversity,
    endangered andor threatened species, waterfowl, marsh and waterbirds, shorebirds,
    gulls, terns, and allied species, raptors, other migratory birds, games animals,
    other resident wildlife, fisheries resources, wildlife propagation and stocking,
    scientific collections, animal control, marking and banding, and disease prevention
    and control.  The public uses of the refuge described in this report include general,
    hunting, fishing, trapping, wildlife observation, other wildlife oriented recreation,
    and law enforcement.  The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    utilization and replacement, communication systems, computer systems, energy conservation,
    and other.  Items of interest are provided at the end.",nt"license_title":
